webpackJsonp([0xd32a93dc8ffb3000],{"./node_modules/json-loader/index.js!./.cache/json/html-elements-em-tag.json":function(e,t){e.exports={data:{markdownRemark:{html:'<h2>Em Tag</h2>\n<p>The <code>&#x3C;em></code> tag is used to emphasize text in an HTML document. This can be done by wrapping the text you would like to be emphasized in an <code>&#x3C;em></code> tag. Most browsers will render text wrapped in an <code>&#x3C;em></code> tag as italicized.</p>\n<p>Note: The <code>&#x3C;em></code> tag should not be used to stylistically italicize text. The <code>&#x3C;em></code> tag is used to stress emphasis on text.</p>\n<h3>Example:</h3>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code><body>\n  <p>\n    Text that requires emphasis should go <em>here</em>.\n  </p>\n</body></code></pre>\n      </div>\n<h4>More Information:</h4>\n<p><a href="https://www.w3schools.com/tags/tag_em.asp">em tag: w3schools</a></p>\n<p><a href="http://htmlreference.io/element/em/">em tag: htmlreference.io</a></p>',fields:{slug:"/html/elements/em-tag/"},frontmatter:{title:"Em Tag"}}},pathContext:{slug:"/html/elements/em-tag/"}}}});
